The Pubsub Component enables data sharing and passing messages between components that arenâ€™t ancestors. Multiple components can register and receive data from the same channel.

This component exposes 4 functions:

*   `register`
*   `unregister`
*   `fire`
*   `shouldExecuteCallbackHandler.shouldExecuteCallback`

To use your component as a listener, add your handler object with the events it wants to handle as a property on your LWC. Then, unregister the handlers in the disconnectedCallback.

Available Methods:

*   `Register`: Register a set of event handlers to a specific channel.
*   `Unregister`: Unregister your set of event handlers from a channel.
*   `Fire`: Fire an event over a specific channel to all registered handlers.
*   `shouldExecuteCallbackHandler.shouldExecuteCallback`: Override this function to implement a check before executing the registered callback.

pubsub.fire("Channel Name", "Event name", { /* payload */ });

The default value returned by shouldExecuteCallbackHandler.shouldExecuteCallback is true. To implement a custom check, return true if you want the callback to execute and false otherwise.

```javascript
pubsub.shouldExecuteCallbackHandler.shouldExecuteCallback = (callback, payload) => {
    //implement the function to return true if you want the callback to execute else return false.
    if (condition) { //some condition.
        return true;
    } else {
        return false;
    }
}
```

import {LightningElement} from "lwc";
import pubsub from "vlocity_ins/pubsub";

export default class MyLwc extends LightningElement {
    connectedCallback() {
        this._myPubSubHandlers = {
            onresult: this.myResultHandler.bind(this)
        };
        pubsub.register(this.channel, this._myPubSubHandlers);
    }

    disconnectedCallback() {
        pubsub.unregister(this.channel, this._myPubSubHandlers);
    }

    myResultHandler(event) {
        // handle the event.
    }
}
